import './index.css';
import { BiHomeAlt2, BiUser, BiInfoCircle, BiLogOut } from "react-icons/bi";
import { FiFeather } from "react-icons/fi";


function App() {
  return (

    <nav className="w-16 h-screen flex flex-col justify-around border border-black items-center">
      <FiFeather />
      <hr className='w-1/2' />
      <div id='functions' className='flex-grow-1'>
        <BiHomeAlt2 />
        <BiUser />
        <BiLogOut />
      </div>
      <hr className='w-1/2' />
      <BiInfoCircle />
    </nav>


  );
}

export default App;
